            '# port scan plugin\nyakit.AutoInitYakit()\n\n/*\n本插件定义的函数主要用于端口扫描的额外扩展\n\n函数定义如下：\nfunc(result *fp.MatchResult)\n\n// 详细结构体定义与内容见模版结尾\n// 这里最关键的是，如果对扫描出的结果有疑问，需要对 MatchResult 进行修改，应该直接\n// 对变量.Field 进行修改。\n\nDEMO:\n\nhandle = func(result) {\n    if result.Fingerprint != nil {\n        if result.Port == 80 && result.GetServiceName() == "" {\n            result.Fingerprint.ServiceName = "http"\n        }\n    }\n}\n\n*/\ncheckList = []\n\ncheckBroker = func(host, port){\n    log.info("正在检测Broker未授权！-----------------------------")\n    payload := "AAAAyQAAALF7ImNvZGUiOjI1LCJleHRGaWVsZHMiOnsiQWNjZXNzS2V5Ijoicm9ja2V0bXEyIiwiU2lnbmF0dXJlIjoiK3pkUmRVdWF6aVNRa0hVVXFkcnR3ZzFGOGprPSJ9LCJmbGFnIjowLCJsYW5ndWFnZSI6IkpBVkEiLCJvcGFxdWUiOjAsInNlcmlhbGl6ZVR5cGVDdXJyZW50UlBDIjoiSlNPTiIsInZlcnNpb24iOjQzM310ZXN0X2tleT10ZXN0X3ZhbHVlCg=="\n   finger = [`"code":0`,`serializeTypeCurrentRPC`]\n    mqClient, err = tcp.Connect(host, port, tcp.clientTimeout(5)) \n    if err != nil{\n        return\n    }\n    package =make([]uint8,1024,1024)\n    wlen, err = mqClient.Write(codec.DecodeBase64(payload)~)\n    if err != nil{\n        return\n    }\n    rlen, err = mqClient.Read(package)\n    if err != nil{\n        return\n    }\n    mqClient.Close()\n    if str.Contains(string(package),finger[0]) && str.Contains(string(package),finger[1]){\n        risk.NewRisk(\n            mqClient.RemoteAddr().String(),\n            risk.payload(payload),\n            risk.severity("high"),\n            risk.title("rocketmq broker未授权CVE-2023-33246"),\n            risk.request(payload),\n            risk.response(string(package)),\n            risk.description("当RocketMQ多个组件，包括NameServer、Broker和Controller，都暴露在外网，并且缺乏有效的身份认证机制，那么攻击者可以利用更新配置功能，以RocketMQ运行的系统用户身份执行命令。"),\n            risk.solution("1、在conf/broker.conf中针对Broker服务添加身份认证，确保只有授权用户才能访问和操作RocketMQ的消息队列。2、使用RocketMQ 4.x版本的用户升级至4.9.6或以上版本。使用RocketMQ 5.x版本的用户升级至5.1.1或以上版本"),\n            risk.type("unauth"),\n            risk.typeVerbose("未授权")\n        )\n    }\n    log.info("Broker未授权检测完成！-----------------------------")\n    return\n}\n\ncheckNamesrv = func(host, port){\n    log.info("正在检测Namesrv未授权！-----------------------------")\n    payload := "AAAA0AAAALJ7ImNvZGUiOjMxOCwiZXh0RmllbGRzIjp7IkFjY2Vzc0tleSI6InJvY2tldG1xMiIsIlNpZ25hdHVyZSI6ImNHSmpxMUZCTSs0VUJsUnNORE50azBVOW5EMD0ifSwiZmxhZyI6MCwibGFuZ3VhZ2UiOiJKQVZBIiwib3BhcXVlIjowLCJzZXJpYWxpemVUeXBlQ3VycmVudFJQQyI6IkpTT04iLCJ2ZXJzaW9uIjo0MzV9dGhpc19pc19rZXk9dGhpc19pc192YWx1ZQo="\n   finger = [`"code":0`,`serializeTypeCurrentRPC`]\n    mqClient, err = tcp.Connect(host, port, tcp.clientTimeout(5)) \n    if err != nil{\n        return\n    }\n    package =make([]uint8,1024,1024)\n    wlen, err = mqClient.Write(codec.DecodeBase64(payload)~)\n    if err != nil{\n        return\n    }\n    rlen, err = mqClient.Read(package)\n    if err != nil{\n        return\n    }\n    mqClient.Close()\n    if str.Contains(string(package),finger[0]) && str.Contains(string(package),finger[1]){\n        risk.NewRisk(\n            mqClient.RemoteAddr().String(),\n            risk.payload(payload),\n            risk.severity("high"),\n            risk.title("rocketmq Namesrv未授权 CVE-2023-37582"),\n            risk.request(payload),\n            risk.response(string(package)),\n            risk.description("当RocketMQ的NameServer组件暴露在外网时，并且缺乏有效的身份认证机制，那么攻击者可以利用更新配置功能，以RocketMQ运行的系统用户身份执行命令。"),\n            risk.solution("1、添加身份认证机制，确保只有授权用户才能访问和操作RocketMQ的消息队列。2、使用RocketMQ 4.x版本的用户升级至4.9.7或以上版本。使用RocketMQ 5.x版本的用户升级至5.1.2或以上版本"),\n            risk.type("unauth"),\n            risk.typeVerbose("未授权")\n        )\n    }\n    log.info("Namesrv未授权检测完成！-----------------------------")\n    return\n}\ncheckList = append(checkList,checkBroker)\ncheckList = append(checkList,checkNamesrv)\n\nhandle = func(result /* *fp.MatchResult */) {\n    // handle match result\n    if !result.IsOpen(){\n        return\n    }\n    if len(result.Fingerprint.HttpFlows) == 0{\n        wg := sync.NewSizedWaitGroup(10)\n        for _, f = range checkList{\n            f := f\n            wg.Add()\n            go func{\n                defer wg.Done()\n                f(result.Target,result.Port)\n            }\n        }\n        wg.Wait()\n    }\n    log.info("%v rocketmq未授权插件检测完成！-----------------------------",result.Target)\n}\n\n/*\n// 具体定义如下：\ntype palm/common/fp.(MatchResult) struct {\n      Target: string  \n      Port: int  \n      State: fp.PortState  \n      Reason: string  \n      Fingerprint: *fp.FingerprintInfo  \n  StructMethods(结构方法/函数): \n  PtrStructMethods(指针结构方法/函数): \n      func GetBanner() return(string) \n      func GetCPEs() return([]string) \n      func GetDomains() return([]string) \n      func GetHtmlTitle() return(string) \n      func GetProto() return(fp.TransportProto) \n      func GetServiceName() return(string) \n      func IsOpen() return(bool) \n      func String() return(string) \n}\n\n\ntype palm/common/fp.(FingerprintInfo) struct {\n      IP: string  \n      Port: int  \n      Proto: fp.TransportProto  \n      ServiceName: string  \n      ProductVerbose: string  \n      Info: string  \n      Version: string  \n      Hostname: string  \n      OperationVerbose: string  \n      DeviceType: string  \n      CPEs: []string  \n      Raw: string  \n      Banner: string  \n      CPEFromUrls: map[string][]*webfingerprint.CPE  \n      HttpFlows: []*fp.HTTPFlow  \n  StructMethods(结构方法/函数): \n  PtrStructMethods(指针结构方法/函数): \n      func FromRegexp2Match(v1: *regexp2.Match) \n}\n*/\n\n',
