            '# port scan plugin\nyakit.AutoInitYakit()\n\nCVEs = []\naddCVE = func(cve, rules, score, severity, titleZh, titleEn) {\n    if (str.Contains(rules, ",")) {\n        rules = str.Join(x.Map(str.Split(rules, ","), func(i) {\n            return sprintf(`(%v)`, str.ReplaceAll(str.TrimSpace(i), ".", `\\.`))\n        }), "|")\n    }\n    CVEs = append(CVEs, {\n        "cve": cve,\n        "rule": rules,\n        "score": score,\n        "severity": severity,\n        "titleZh": titleZh,\n        "titleEn": titleEn, \n    })\n}\n\naddCVE("CVE-2004-0042", "1.1.3","5.0", "MEDIUM", "vsftpd合规检查-CVE-2004-0042", "Vsftpd identifies valid user name vulnerabilities")\naddCVE("CVE-2004-2259", "1.2.0, 1.2.1","5.0", "MEDIUM", "vsftpd合规检查-CVE-2004-2259", "Beasts vsftpd 1.2.0/1.2.1 Crash DOS")\naddCVE("CVE-2009-4457", "1.2a, 1.2b","7.5", "HIGH", "vsftpd合规检查-CVE-2009-4457", "Vsftpd_webmin_module Unspecified vulnerability")\naddCVE("CVE-2011-0762", "0.[0-9].[0-1]?[0-9], 1.[0-2].[0-3], 2.0.[0-7], 2.1.[0-2], 2.2.[0-2], 2.3.[0-1]","4.0", "MEDIUM", "vsftpd合规检查-CVE-2011-0762", "Beasts vsftpd up to 0.0.13 ls.c vsf_filename_passes_filter DOS")\naddCVE("CVE-2011-2523", "[0-2].[0-9].[0-9][0-9]?, 3.0.[0-1][0-9]?","5.0", "MEDIUM", "vsftpd合规检查-CVE-2011-2523", "Vsftpd Code Execution")\n\n\nhandle = func(result /* *fp.MatchResult */) {\n    // handle match result\n    if !result.IsOpen() {\n        return\n    }\n\n    if result.Fingerprint == nil {\n        return\n    }\n    if str.MatchAllOfRegexp(result.GetServiceName(),"(?i)vsftpd") {\n    yakit.Info("cves: %d", len(CVEs))\n\n        x.Foreach(CVEs, func(i) {\n            defer func{\n                err = recover()\n                if err != nil {\n                    yakit.Error("Vsftpd CVE 合规检查失败：%v", err)\n                }\n            }\n            if !str.MatchAllOfRegexp(result.Fingerprint.Version, i.rule) {\n                return\n            }\n\n            target := str.HostPort(result.Target, result.Port)\n            targetOutput := sprintf("(%v)", target)\n            risk.NewRisk(\n                target, \n                risk.title(sprintf(`%v`,  i["titleZh"])),\n                risk.titleVerbose(sprintf(`%v`, i["titleZh"])),\n                risk.type("cve-baseline"),\n                risk.typeVerbose("CVE基线检查"),\n                risk.parameter(result.Fingerprint.Banner),\n                risk.potential(true),\n                risk.level("low"),\n                risk.details(i),\n                risk.cve(i.cve),\n            )\n            println(i.cve)\n        })\n    }\n}\n',
