            'yakit.AutoInitYakit()\n\n# Input your code!\n\n// 协议\nschemaHttp := "http://"\nschemaHttps := "https://"\n\n// 请求包超时\ntimeout := http.timeout(cli.Int("timeout"));\n// ua头\nua := http.useragent(cli.String("user_agent"))\naccept := http.header("Accept", "text/html,application/xhtml+xml,application/xml;q=0.9,image/avif,image/webp,image/apng,*/*;q=0.8,application/signed-exchange;v=b3;q=0.7")\n// ae := http.header("Accept-Encoding", "gzip, deflate, br")\nae := http.header("Accept-Encoding", "")\nal := http.header("Accept-Language", "en-US,zh;q=0.9")\nscu := http.header("sec-ch-ua", `"Chromium";v="112", "Google Chrome";v="112", "Not:A-Brand";v="99"`)\n\n// 表格数据\nyakit.EnableTable("存活URL信息表", ["URL", "标题", "状态码", "响应包"])\n// 增加表格数据\noutputTable = func(url, title, code, packet) {\n    data = make(map[string]var)\n    data["URL"] = url\n    data["标题"] = title\n    data["响应包"] = packet\n    data["状态码"] = code\n    yakit.TableData("存活URL信息表", data)\n}\n\n// 发送请求 默认GET\nfunc sendRequest(url) {\n    req, err = http.NewRequest("GET", url, ua, timeout, accept, ae, al, scu)\n    if (err != nil) {\n        return nil, false\n    }\n\n    rsp, err := http.Do(req)\n    return rsp, true\n}\n\n// 探测url\nfunc detectUrls(urlArr) {\n    // 遍历url列表\n    for i, v := range urlArr {\n        // 日志开关\n        if cli.Bool("showLog") {\n            printf("%d\\r", i+1)\n        }\n\n        // 拼接协议\n        url := schemaHttps + v\n        rsp, err := sendRequest(url)\n        if (!err || rsp == nil) {\n            // 尝试http协议\n            url = schemaHttp + v\n            if cli.Bool("showLog") {\n                println("[*_*] try other: ", url)\n            }\n            \n            rsp, err = sendRequest(url)\n            if (!err || rsp == nil) {\n                continue\n            }\n            \n        }\n\n        // 导出响应头\n        headerBytes, err := http.dumphead(rsp)\n        // 导出响应体\n        packetBytes, err := http.dump(rsp)\n        packetHeader := string(headerBytes)\n        packet := string(packetBytes)\n        \n        // 匹配title\n        title := "-"\n        res := re.FindSubmatchAll(packet, `<title.*?>(.*?)</title>`)\n        // println(res)\n        if (len(res) > 0 && len(res[0]) > 1) {\n            title = res[0][1]\n        }\n\n        // 匹配状态码\n        code = re.Find(packetHeader, `\\b\\d{3}\\b`)\n\n        // 填充数据\n        outputTable(url, title, code, packetHeader)\n        printf("====================================\\n")\n        printf("[+_+] %s\\n", url)\n        // http.show(req)\n        // http.show(rsp)\n        printf("====================================\\n\\n")\n        // raw, err := io.ReadAll(rsp.Body)\n        // if (err != nil) {\n        //     continue\n        // }\n        // println(string(raw))\n    }\n}\n\n// 入口\nfunc main() {\n    urls := cli.String("urls")\n    urls = str.TrimSpace(urls)\n    if (urls == "") {\n        return\n    }\n\n    // 换行符切割文本\n    urlArr := str.Split(urls, "\\n")\n    for (i := 0; i < len(urlArr); i++) {\n        // 移除带有协议字符\n        if str.Contains(urlArr[i], schemaHttp) {\n            urlArr[i] = str.ReplaceAll(urlArr[i], schemaHttp, "")\n        } else if str.Contains(urlArr[i], schemaHttps) {\n            urlArr[i] = str.ReplaceAll(urlArr[i], schemaHttps, "")\n        }\n        \n    }\n\n    detectUrls(urlArr)\n}\n\nmain()\n',
